        <Col sm={6} md={4}>
            <div className="blog-imbx">
                <img src={imgUrl} />
                <div className="blog-txtx">
                    <h4>{title}</h4>
                    <span>{description}</span>
                </div>
            </div>
        </Col>
    )
}
